import { useEffect } from "react";
import { useCBOContext } from "../hooks/useCBOcontext";
import { Link, useNavigate } from "react-router-dom";

// Components
import CBODetails from "../components/CBODetails";

const Home = () => {
  const { cbos, dispatch } = useCBOContext();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchCBOs = async () => {
      const response = await fetch("/api/cbos");
      const json = await response.json();

      if (response.ok) {
        dispatch({ type: "SET_CBOS", payload: json });
      }
    };

    fetchCBOs();
  }, [dispatch]);

  return (
    <div className="home">
      <div className="search-bar">
        <input type="text" placeholder="Search for a CBO..." />
      </div>
      <div className="cbos">
        {cbos &&
          cbos.map((cbo) => (
            <div key={cbo._id} className="cbo-item">
              <Link to={`/cbo/${cbo._id}`}>
                <CBODetails cbo={cbo} />
              </Link>
            </div>
          ))}
      </div>

      {/* Register button starts step 1 */}
      <button className="register-button" onClick={() => navigate("/register?step=1")}>
        Register
      </button>
    </div>
  );
};

export default Home;
